create table address (id integer auto_increment, person_id integer, address1 varchar(100), address2 varchar(100), city varchar(100), state varchar(2), postal_code varchar(10), primary key(id));
create table phone (id integer auto_increment, person_id integer, phone_type varchar(10), phone_number varchar(20), primary key (id));
create table denormalized_person (
   first_name varchar(100),
